import React, {Component} from 'react';
import {NavLink} from "react-router-dom";

class MyNavLink extends Component {
    render() {
        return (
            <div>
                <NavLink activeClassName="bar_active" className="bar" {...this.props} />
            </div>
        );
    }
}

export default MyNavLink;
